import React from 'react'
import "./Navbar.css"
import BugImg from "../images/bug.svg"

const Navbar = () => {
  return (
    <div>
        <h1><img src={BugImg} className='Bug-image' alt='Bug' /> Bug Tracker</h1>
    </div>
  )
}

export default Navbar
